  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          process.env.REACT_APP_HOST + "/api/ping/check-cctv2"
        );
        setApiData(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Table3</h1>
      <table>
        <thead>
          <tr>
            {data &&
              data.data.map((item) => (
                <th style={{ writingMode: "vertical-lr" }}>{item.name}</th>
              ))}
          </tr>
        </thead>
        <tbody>
          <tr>
            {" "}
            {data &&
              data.data.map((item) => (
                <td>
                  <table>
                    
                  </table>

                </td>
              ))}
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Table3;
